# Definition for singly-linked list.# class ListNode(object):#     def __init__(self, x):#         self.val = x#         self.next = Noneclass Solution(object):    def reorderList(self, head):        """        :type head: ListNode        :rtype: void Do not return anything, modify head in-place instead.        """        cur,nums=head,[]        while cur:            nums.append(cur)            cur=cur.next        n=len(nums)        if n<2:            return        left,right=0,n-1        while right>left:            nums[left].next=nums[right]            left+=1            nums[right].next=nums[left]            right-=1        if left==right:            nums[right+1].next=nums[left]        nums[left].next=None        return